import React from "react";
import { Container, Footer, Header, Section } from "./Layout.styled";

const Layout = ({ children }) => {
  return (
    <Container>
      <Header>Header</Header>
      <Section>{children}</Section>
      <Footer>Footer</Footer>
    </Container>
  );
};

export default Layout;
